        <p parentName="li">{`Grafana 7.1 and later with a new plug-in platform supported.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Data Source can connect to any Redis database. No special configuration is required.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Redis Cluster and Sentinel supported since version 1.2.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Data Source supports:`}</p>
        <ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://oss.redislabs.com/redistimeseries/"
            }}>{`RedisTimeSeries`}</a>{`: TS.GET, TS.INFO, TS.MRANGE, TS.QUERYINDEX, TS.RANGE`}</li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://oss.redislabs.com/redisgears/"
            }}>{`RedisGears`}</a>{`: RG.DUMPREGISTRATIONS, RG.PYEXECUTE, RG.PYSTATS`}</li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://oss.redislabs.com/redisearch/"
            }}>{`RedisSearch`}</a>{`: FT.INFO`}</li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://oss.redislabs.com/redisgraph/"
            }}>{`RedisGraph`}</a>{`: GRAPH.QUERY, GRAPH.SLOWLOG`}</li>
        </ul>
      </li>
    </ul>
    <Tabs defaultValue="Using Homebrew" values={[{
      label: 'Using Homebrew',
      value: 'Homebrew'
