  <TabItem value="Using Homebrew" mdxType="TabItem">
        <h4 {...{
          "id": "using-homebrew"
        }}>{`Using Homebrew`}</h4>
        <h4 {...{
          "id": "step-1-install-grafana"
        }}>{`Step 1. Install Grafana`}</h4>
