            "className": "language-bash"
          }}>{` brew install grafana
`}</code></pre>
        <h4 {...{
          "id": "step-2-install-redis-datasource"
        }}>{`Step 2. Install Redis Datasource`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` grafana-cli plugins install redis-datasource
`}</code></pre>
        <p>{`The brew page downloads and untars the files into /usr/local/Cellar/grafana/version.`}</p>
        <h4 {...{
          "id": "step-3-start-grafana-service"
        }}>{`Step 3. Start Grafana service`}</h4>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` brew services start grafana
`}</code></pre>
