        <h4 {...{
          "id": "step-7-select-redis-as-data-source-type"
        }}>{`Step 7. Select "Redis" as data source type`}</h4>
        <p><img alt={"grafana"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./grafana_datasource3.png").default} /></p>
