          "id": "using-docker"
        }}>{`Using Docker`}</h4>
        <p>{`You can install and run Grafana using the official Docker image. `}</p>
        <h4 {...{
          "id": "step-1-install-docker"
        }}>{`Step 1. Install Docker`}</h4>
        <p>{`The first step is to install docker for your operating system. Run the docker version command in a terminal window to make sure that docker is installed correctly.`}</p>
        <p>{`Note - On Windows and Mac, install docker version 18.03 or higher. You can run docker version to find out your docker version.`}</p>
        <h4 {...{
          "id": "step-2-run-grafana-docker-container"
        }}>{`Step 2. Run Grafana Docker container`}</h4>
        <p>{`Pass the plugins you want installed to Docker with the GF_INSTALL_PLUGINS environment variable as a comma-separated list. This sends each plugin name to grafana-cli plugins install \${plugin} and installs them when Grafana starts.
In our case, we will be using redis-datasource.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` docker run -d -p 3000:3000 --name=grafana -e "GF_INSTALL_PLUGINS=redis-datasource" grafana/grafana
`}</code></pre>
        <h4 {...{
          "id": "step-3-accessing-the-grafana-dashboard"
        }}>{`Step 3. Accessing the grafana dashboard`}</h4>
